import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ReactiveFormsModule } from '@angular/forms';
import { SharedModule } from 'app/shared/shared.module';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { DynamicDialogModule } from 'primeng/dynamicdialog';
import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { MultiSelectModule } from 'primeng/multiselect';
import { TabViewModule } from 'primeng/tabview';
import { TableModule } from 'primeng/table';

import { ConfirmationService, MessageService } from 'primeng/api';
import { DialogService } from 'primeng/dynamicdialog';
import { IcCodeService } from 'app/ng-connect';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';

import { OverviewComponent } from './overview.component';
import { OverviewRoutingModule } from './overview-routing.module';
import { AccessRightRequestComponent } from './access-right-request/access-right-request.component';
import { ViewAccessRightRequestComponent } from './access-right-request/view-access-right-request-modal/view-access-right-request.component';
import { CreateAccessRightRequestComponent } from './access-right-request/create-access-right-request-modal/create-access-right-request.component';
import { CurrentAccessComponent } from './current-access/current-access.component';
import { ViewCurrentAccessComponent } from './current-access/view-current-access-modal/view-current-access.component';
import { AccessRightReviewComponent } from './access-right-review/access-right-review.component';
import { ViewAccountsReviewComponent } from './access-right-review/view-accounts-review-modal/view-accounts-review.component';
import { AccountsReviewSettingsComponent } from './access-right-review/accounts-review-settings-modal/accounts-review-settings.component';
import { ReviewUnitSettingsComponent } from './access-right-review/accounts-review-settings-modal/review-unit-settings/review-unit-settings.component';
import { AccountsReviewersTableComponent } from './access-right-review/accounts-review-settings-modal/accounts-reviewers-table/accounts-reviewers-table.component';
import { AccountStatusPipe } from './pipe/account-status.pipe';

@NgModule({
  declarations: [
    OverviewComponent,
    AccessRightRequestComponent,
    ViewAccessRightRequestComponent,
    CreateAccessRightRequestComponent,
    CurrentAccessComponent,
    ViewCurrentAccessComponent,
    AccessRightReviewComponent,
    ViewAccountsReviewComponent,
    AccountsReviewSettingsComponent,
    ReviewUnitSettingsComponent,
    AccountsReviewersTableComponent,
    AccountStatusPipe
  ],
  imports: [
    CommonModule,
    SharedModule,
    ButtonModule,
    CalendarModule,
    ConfirmPopupModule,
    DialogModule,
    DropdownModule, 
    DynamicDialogModule,
    InputTextModule,
    InputTextareaModule,
    MultiSelectModule,
    ReactiveFormsModule,
    TabViewModule,
    TableModule,
    OverviewRoutingModule
  ],
  providers: [ConfirmationService, MessageService, DialogService, NspConfirmationService, IcCodeService]
})

export class OverviewModule {}
